import type { Session } from './App';

import React, { useState } from 'react';

import { List, Tag } from 'antd';

interface Props {
  title?: string;
  sessions: Session[];
}

const CourseList: React.FC<Props> = ({ title, sessions }) => {
  return (
    <List
      header={<h3>{title}</h3>}
      // bordered
      size="small"
      style={{ width: 270 }}
      dataSource={sessions}
      renderItem={(item) => (
        <List.Item style={{ backgroundColor: item.color }} actions={[<Tag>{item.time}mins</Tag>]}>
          {item.title}
        </List.Item>
      )}
    />
  );
};

export default CourseList;
